/**
 * @param {number} n
 * @param {number[]} rollMax
 * @return {number}
 */
var dieSimulator = function (n, rollMax) {
  const MOD = 1_000_000_007;
  const maxRun = Math.max(...rollMax); // up to 15

  // dp[length][face][run] where face in [0..5], run in [1..maxRun]
  const dp = Array.from({ length: n + 1 }, () =>
    Array.from({ length: 6 }, () => Array(maxRun + 1).fill(0))
  );

  // base: sequences of length 1
  for (let f = 0; f < 6; f++) dp[1][f][1] = 1;

  for (let len = 2; len <= n; len++) {
    for (let f = 0; f < 6; f++) {
      const limit = rollMax[f];

      // continue the same face if under its limit
      for (let run = 2; run <= limit; run++) {
        dp[len][f][run] = (dp[len][f][run] + dp[len - 1][f][run - 1]) % MOD;
      }

      // switch from any other face -> run length 1
      let fromOthers = 0;
      for (let pf = 0; pf < 6; pf++) {
        if (pf === f) continue;
        const prevLimit = rollMax[pf];
        for (let run = 1; run <= prevLimit; run++) {
          fromOthers += dp[len - 1][pf][run];
          if (fromOthers >= MOD) fromOthers -= MOD;
        }
      }
      dp[len][f][1] = (dp[len][f][1] + fromOthers) % MOD;
    }
  }

  // sum all ways of length n
  let ans = 0;
  for (let f = 0; f < 6; f++) {
    const limit = rollMax[f];
    for (let run = 1; run <= limit; run++) {
      ans += dp[n][f][run];
      if (ans >= MOD) ans -= MOD;
    }
  }
  return ans;
};

/**
 * Sliding window with fixed-size frequency arrays for O(26 * n).
 * @param {string} s
 * @param {string} p
 * @return {number[]}
 */
var findAnagrams = function (s, p) {
  const res = [];
  const m = p.length;
  const n = s.length;
  if (m > n) return res;

  const aCode = "a".charCodeAt(0);
  const need = new Array(26).fill(0);
  const window = new Array(26).fill(0);

  for (const ch of p) need[ch.charCodeAt(0) - aCode]++;

  // seed the first window
  for (let i = 0; i < m; i++) window[s.charCodeAt(i) - aCode]++;

  const matches = () => {
    for (let i = 0; i < 26; i++) if (need[i] !== window[i]) return false;
    return true;
  };

  if (matches()) res.push(0);

  for (let right = m; right < n; right++) {
    const addIdx = s.charCodeAt(right) - aCode;
    const removeIdx = s.charCodeAt(right - m) - aCode;
    window[addIdx]++;
    window[removeIdx]--;
    if (matches()) res.push(right - m + 1);
  }

  return res;
};

// Doubly linked list node
function Node(key, value) {
    this.key = key;
    this.value = value;
    this.prev = null;
    this.next = null;
}

/**
 * @param {number} capacity
 */
var LRUCache = function(capacity) {
    this.capacity = capacity;
    this.map = new Map();

    // Sentinel head/tail to simplify insert/remove logic
    this.head = new Node(0, 0);
    this.tail = new Node(0, 0);
    this.head.next = this.tail;
    this.tail.prev = this.head;
};

// Internal: remove a node from the list
LRUCache.prototype._remove = function(node) {
    node.prev.next = node.next;
    node.next.prev = node.prev;
};

// Internal: insert node right after head (mark as most recently used)
LRUCache.prototype._addAfterHead = function(node) {
    node.prev = this.head;
    node.next = this.head.next;
    this.head.next.prev = node;
    this.head.next = node;
};

// Move existing node to front
LRUCache.prototype._moveToFront = function(node) {
    this._remove(node);
    this._addAfterHead(node);
};

/** 
 * @param {number} key
 * @return {number}
 */
LRUCache.prototype.get = function(key) {
    if (!this.map.has(key)) return -1;
    const node = this.map.get(key);
    this._moveToFront(node);
    return node.value;
};

/** 
 * @param {number} key 
 * @param {number} value
 * @return {void}
 */
LRUCache.prototype.put = function(key, value) {
    if (this.map.has(key)) {
        const node = this.map.get(key);
        node.value = value;
        this._moveToFront(node);
        return;
    }

    if (this.map.size === this.capacity) {
        // Evict least recently used (node before tail)
        const lru = this.tail.prev;
        this._remove(lru);
        this.map.delete(lru.key);
    }

    const node = new Node(key, value);
    this._addAfterHead(node);
    this.map.set(key, node);
};

