/**
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
var findKthLargest = function(nums, k) {
    // Use a size-k min-heap to keep the k largest elements seen so far.
    const heap = [];

    const swap = (i, j) => {
        const tmp = heap[i];
        heap[i] = heap[j];
        heap[j] = tmp;
    };

    const siftUp = (idx) => {
        while (idx > 0) {
            const parent = Math.floor((idx - 1) / 2);
            if (heap[parent] <= heap[idx]) break;
            swap(parent, idx);
            idx = parent;
        }
    };

    const siftDown = (idx) => {
        const n = heap.length;
        while (true) {
            let smallest = idx;
            const left = idx * 2 + 1;
            const right = idx * 2 + 2;

            if (left < n && heap[left] < heap[smallest]) smallest = left;
            if (right < n && heap[right] < heap[smallest]) smallest = right;

            if (smallest === idx) break;
            swap(idx, smallest);
            idx = smallest;
        }
    };

    for (const num of nums) {
        if (heap.length < k) {
            heap.push(num);
            siftUp(heap.length - 1);
        } else if (num > heap[0]) {
            heap[0] = num;
            siftDown(0);
        }
    }

    return heap[0];
};

/**
 * @param {number[]} nums
 * @return {number}
 */
var majorityElement = function(nums) {
    // Boyer–Moore Voting Algorithm: track a candidate and its balance
    let candidate = null;
    let count = 0;

    for (const num of nums) {
        if (count === 0) {
            candidate = num;
        }
        count += num === candidate ? 1 : -1;
    }

    return candidate;
};
